(226, '2016-06-16 11:00:00', 'A Day at the Farm', '<p>\r\nGood ole Country Music, Old Fashioned Hay Wagon Rides and much, much more!<br />\r\nMusic by Donna and The Country Mystics<br />\r\nand by special request<br />\r\nA performance with Donna and her handsome horse Doc!\r\n</p>\r\n<p class="description">\r\nThats right, this show will include lots of goodies at the farm. Come see our display of Farmall Tractors, enjoy a tractor pulled hayride through the country with a special stop at our very own rendition of Petticoat Junction. There you can enjoy a taste of cheese and wine, then back to the barn with all the comforts of the country, to enjoy some good ole country music, a chicken barbeque buffet with all the fixins and a patriotic grand finale with Donna and her horse Doc!<br />\r\nTruly a spectacular event you wont want to miss!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Chicken Barbeque Buffet</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Good Ole Country Music Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-02-03 05:02:39', 'dinnerShow', 0, 0, 0, 'active'),
(227, '2016-07-21 11:00:00', 'Kickin\' Kountry Klassics', '<p>\r\nPerformed by J&J Klassics\r\n</p>\r\n<p class="description">\r\nCome enjoy this Dynamic Duo as they perform all your favorite country songs. You will find yourself singing, clapping and tapping along to this full sounding Duo as Julie sings you great songs from the Queens of Country music like Connie Smith, Loretta Lynn, Kitty Wells, Dolly Parton and many more. The other half of the Duo will feature Jimmy Fowler as he plays some sweet guitar pickin mixed in with some hot pickin leads and sings you his great rendition of Willie Nelson, Buck Owens, Merle Haggard, Johnny Cash and many others!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Luncheon Buffet w/ assorted meats, cheeses,\r\nrolls, salads and much, much more!</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Kickin Kountry Klassics Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-05-26 03:03:47', 'dinnerShow', 0, 0, 0, 'delete'),
(228, '2016-08-11 11:00:00', 'The Rich Wilson Show', '<p>\r\nBacked by Donna and the Country Mystics<br />\r\n\r\n</p>\r\n<p class="description">\r\nRich Wilson has been a paid professional entertainer since age 15. His unique ability to stand before any size audience shows he is a seasoned veteran to the music scene. Come enjoy all the classic country songs from years gone by bringing back memories of artists such as Eddy Arnold, Hank Williams, Jerry Lee Lewis, Ray Price and many, many more! Rich will entertain you like none other from beginning to end, a show you will truly enjoy!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Pulled Pork/Baked Chicken Buffet</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>The Rich Wilson Classic Country Music Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-02-03 05:09:07', 'dinnerShow', 0, 0, 0, 'active'),
(229, '2016-09-08 11:00:00', 'Raising Cane in the Country', '<p>\r\nwith Donna and the Country Mystics<br />\r\n\r\n</p>\r\n<p class="description">\r\nCome join us for a day of fun and music as we bring to you a kick up your heels kind of day! With a blend of country music with a variety of sing-a-longs everyone is sure to remember. Feel like part of the band as we provide a variety of musical instruments fit for everyone or anyone to play. You will enjoy the cuteness of our little mini horse Annie as she makes her way through the audience with her own little cart, surely a sight to see!!<br />\r\nDont forget your boots and hat! Yeehaa!!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Italian Buffet</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Raising Cane in the Country Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-05-26 03:04:32', 'dinnerShow', 0, 0, 0, 'delete'),
(230, '2016-05-05 18:30:00', 'Thursday Game Night', '<p>\r\nBegins at 6:30pm\r\n<br />\r\nEntries will be taken from 6:00pm to 6:30pm in the Office\r\n</p>\r\n\r\n<p>\r\n<ul>\r\n<li>Admission: $10.00 to Ride all 3 events</li>\r\n<li>Optional: $10.00 for the Dash for Cash</li>\r\n</ul>\r\n</p>\r\n\r\n<p>\r\nThere will be two divisions intermediate and advanced.\r\n<br />\r\nEach Thursday will be clover leaf pattern (barrel racing) with two optional mystery games\r\n<br />\r\nDash for Cash, winner with the fastest time takes all. (Additional $10.00)\r\n</p>\r\n\r\n<p>\r\nEveryone is welcome! So come have some fun. \r\n<br />\r\nAny other questions feel free to contact Donna at 315-224-9085\r\n</p>', NULL, '2016-04-30 19:16:55', 'competition', 0, 0, 0, 'active'),
