(362, '2016-08-06 08:00:00', 'Shane Ogden Clinic', '<p>\r\nTWO DAY CLINIC AND BARN DANCE!\r\n</p>\r\n<p class="description">\r\nTwo day clinic with trainer and instructor Shane Ogden. Shane encourages the bond between horse and rider through clear and thoughtful communication with every step. He builds skills through his patient and well explained methods of training for both horse and rider as one. He builds not only soft horses but confident riders that always take something away from time spent under his instruction.\r\n<br />\r\nThe clinic has 18 sessions available over two days and will fill up on a first come first serve basis. We have stalls and camp sites available upon request. Auditors are encouraged to attend! Lunch will be available at our on site cook shack. \r\n<br />\r\nSaturday evening we will be hosting a chicken BBQ followed by a barn dance played by Donna and the Country Mystics.<br />\r\n</p>\r\n<p>\r\n<table><b>Times:</b>\r\n<tr><td>8 am</td><td>Clinic Begins</td></tr>\r\n<tr><td>6 pm</td><td>Chicken BBQ</td></tr>\r\n<tr><td>8 pm</td><td>Barn Dance</td></tr>\r\n</table>\r\n\r\n<table><b>Cost:</b>\r\n<tr><td>$100 per hour for private session</td></tr>\r\n<tr><td>$60 per rider per hour for group session</td></tr>\r\n<tr><td>$15 Audit fee per day </td></tr>\r\n<tr><td>($20 if attending barn dance Saturday)</td></tr>\r\n<tr><td>$15 per person Chicken BBQ Saturday evening</td></tr>\r\n<tr><td>$25 per day for a stall</td></tr>\r\n<tr><td>$25 per night for a camp site</td></tr>\r\n<tr><td>$6 per person for just barn dance Saturday night</td></tr>\r\n</table>\r\n</p>\r\n\r\n<p>\r\n<br />\r\nDownload and Fill out the Registration Form here.<br />\r\nEmail Registration or Mail in.<br />\r\nPlease direct questions to Sarah Spence at 207-754-6388\r\n</p>', NULL, '2016-06-29 05:21:28', 'class', 0, 0, 0, 'active'),
(363, '2016-08-07 08:00:00', 'Shane Ogden Clinic', '<p>\r\nTWO DAY CLINIC AND BARN DANCE!\r\n</p>\r\n<p class="description">\r\nTwo day clinic with trainer and instructor Shane Ogden. Shane encourages the bond between horse and rider through clear and thoughtful communication with every step. He builds skills through his patient and well explained methods of training for both horse and rider as one. He builds not only soft horses but confident riders that always take something away from time spent under his instruction.\r\n<br />\r\nThe clinic has 18 sessions available over two days and will fill up on a first come first serve basis. We have stalls and camp sites available upon request. Auditors are encouraged to attend! Lunch will be available at our on site cook shack. \r\n</p>\r\n<p>\r\n<table><b>Times:</b>\r\n<tr><td>8 am</td><td>Clinic Begins</td></tr>\r\n</table>\r\n\r\n<table><b>Cost:</b>\r\n<tr><td>$100 per hour for private session</td></tr>\r\n<tr><td>$60 per rider per hour for group session</td></tr>\r\n<tr><td>$15 Audit fee per day </td></tr>\r\n<tr><td>$25 per day for a stall</td></tr>\r\n<tr><td>$25 per night for a camp site</td></tr>\r\n</table>\r\n</p>\r\n\r\n<p>\r\n<br />\r\nDownload and Fill out the Registration Form here.<br />\r\nEmail Registration or Mail in.<br />\r\nPlease direct questions to Sarah Spence at 207-754-6388\r\n</p>', NULL, '2016-06-29 05:22:59', 'class', 0, 0, 0, 'active'),
(364, '2017-06-15 11:00:00', 'Elvis Dinner Show', '<p>\r\nTom Gilbo<br />\r\n\r\n</p>\r\n<p class="description">\r\nA Show you wont wanna miss. Tom Gilbo (as Elvis) and his group the\r\nBlue Suedes bring back all the favorite songs youll remember of Elvis\r\nPresley. Tom will entertain you from start to finish as you shake, rattle\r\nand roll the afternoon away. Tom has all the moves and grooves and a\r\nvoice to match. The ladies will be screamin for their hugs, kisses and\r\nscarves from this terrific show! One you wont wanna let pass you by!!!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Petticoat Junction Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Sausage/Chicken Chicken Buffet with all the fixin\' and desserts</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Elvis Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-12-16 23:49:55', 'dinnerShow', 0, 0, 0, 'active'),
(365, '2017-07-13 11:00:00', 'The Rich Wilson Show', '<p>\r\nBacked by Donna and the Country Mystics<br />\r\n\r\n</p>\r\n<p class="description">\r\nRich Wilson has been a paid professional entertainer since age 15. His unique ability to stand before any size audience shows he is a seasoned veteran to the music scene. Come enjoy all the classic country songs from years gone by bringing back memories of artists such as Eddy Arnold, Hank Williams, Jerry Lee Lewis, Ray Price and many, many more! Rich will entertain you like none other from beginning to end, a show you will truly enjoy!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Petticoat Junction Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Pulled Pork/Chicken BBQ Buffet</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>The Rich Wilson Classic Country Music Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2017-04-28 04:59:37', 'dinnerShow', 1, 0, 0, 'active');
