(366, '2017-08-16 11:00:00', 'Donna and Doc Dinner Show', '<p class="description">\r\nThats right, this show will include lots of goodies at the Farm. Come see\r\nour display of Farmall Tractors, enjoy a tractor pulled hayride through\r\nthe country with a special stop at our very own rendition of Petticoat\r\nJunction. There you can enjoy a taste of cheese and wine, then back to\r\nthe barn with all the comforts of the country, to enjoy some good ole\r\ncountry music, a chicken barbeque buffet with all the fixins and a patri-\r\notic grand finale with Donna and her horse Doc!!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>Hawaiian Sliced Ham/Chicken BBQ Buffet with all the fixin\'s and dessert</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Good Ole Country Music Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call Donna at (315)224-9085<br />\r\n*Dancing is allowed*\r\n</p>', NULL, '2016-12-17 00:03:50', 'dinnerShow', 0, 0, 0, 'active'),
