(423, '2017-06-17 17:00:00', 'Rockin\' Rodeo', '<p>\r\nSouthern Tier Stables First Annual Rockin\' Rodeo<br />\r\n\r\n</p>\r\n<p class="description">\r\nSanctioned: *pending APRA** PCRA <br />\r\n\r\nFor information about registering call Louis Backlas @ 716-525-6011 or <br /> \r\nFacebook page: Cross Over The Line Rodeo Co. <br />\r\n\r\n** Food and refreshments will be available <br />\r\n** Beer and wine coolers will be available <br />\r\n\r\nThank you to our current sponsors! <br />\r\n<table>\r\n<tr><td>Runnings</td><td>Essex Steel</td></tr>\r\n<tr><td>R&B Alternative Solutions</td><td>Maguire Family of Dealerships</td></tr>\r\n<tr><td>Trucks and Stuff</td><td>Big Red\'s Dentistry</td></tr>\r\n<tr><td>CNY Hot Tubs</td><td>BB\'s Mechanicals</td></tr>\r\n<tr><td>Performance Automotive</td><td>Ken Delaney Excavation</td></tr>\r\n</table>\r\n<p>\r\n** If your company is interested in becoming a sponsor please contact Sarah Spence @ sarahspence89@hotmail.com or call 207-754-6388.\r\n</p>\r\n<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>4:00pm</td><td>Gates Open</td></tr>\r\n<tr><td>5pm</td><td>Rodeo Starts</td></tr>\r\n<tr><td>9pm</td><td>Music by Tink Bennett and Tailor Made</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nRodeo Tickets:\r\n<table>\r\n<tr><td>$12</td><td>Pre-order Adult</td></tr>\r\n<tr><td>$15</td><td>At-the-gate Adult </td></tr>\r\n<tr><td>$10</td><td>Children 13 and under</td></tr>\r\n<tr><td></td><td>Children under 5 are free</td></tr>\r\n<tr><td></td><td>$5 at the door for music</td></tr>\r\n</table>\r\n</p>\r\n\r\n\r\nFor pre-order tickets call Donna Minnoe @ 315-224-9085 <br />\r\nno later than June 10th\r\n</p>', NULL, '2017-04-10 19:50:33', 'show', 0, 0, 0, 'active'),
(424, '2017-12-06 11:00:00', 'Donna & the Country Mystics<br /> Christmas Dinner Show<br /> In Geneva,NY', '<p>\r\n<b>Donna & the Country Mystics</b><br />\r\nWinnek Post 396<br />\r\nAmerican Legion,<br />\r\n1115 Lochland Rd., Geneva NY\r\n\r\n</p>\r\n<p class="description">\r\nEnjoy the Show with many extras as the Mystics put you in the Christmas Spirit. With a Christ-\r\nmas Singalong and Highlights with Santa Claus, Santa Baby, Frosty, Dominick the Donkey,\r\nTwelve Days of Christmas, Mzzz Elvizzz, and a Finale to Honor Our Veterans in the crowd.<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Light Hors doeuvres, Cash Bar\r\nWith Xmas Trivia and Fun</td></tr>\r\n<tr><td>12:30-2:00pm</td><td>Family Style Baked Seasoned Chicken/Roast Beef Dinner with All The Fixins and dessert</td></tr>\r\n<tr><td>2:00-4:30pm</td><td>Christmas Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations call<br /> The American Legion 315-789-5165<br />\r\nBus Reservations Call Donna at (315)224-9085<br />\r\n</p>', NULL, '2017-05-03 14:31:53', 'dinnerShow', 0, 0, 0, 'active'),
(425, '2017-05-11 18:30:00', 'Thursday Game Night', '<p>\r\nBegins at 6:30pm\r\n<br />\r\nEntries will be taken from 6:00pm to 6:30pm in the Office\r\n</p>\r\n\r\n<p>\r\n<ul>\r\n<li>Admission: $10.00 to Ride all 3 events</li>\r\n<li>Optional: $10.00 for the Dash for Cash</li>\r\n</ul>\r\n</p>\r\n\r\n<p>\r\nThere will be two divisions intermediate and advanced.\r\n<br />\r\nEach Thursday will be clover leaf pattern (barrel racing) with two optional mystery games\r\n<br />\r\nDash for Cash, winner with the fastest time takes all. (Additional $10.00)\r\n</p>\r\n\r\n<p>\r\nEveryone is welcome! So come have some fun. \r\n<br />\r\nAny other questions feel free to contact Donna at 315-224-9085\r\n</p>', NULL, '2017-05-03 14:05:26', 'show', 0, 0, 0, 'active'),
