(501, '2018-08-02 11:00:00', 'An Old Fashion Country Music Hoe Down', '<p>\r\n<b>Donna and The Country Mystics with Kenny Derr</b><br />\r\nPresent An Old Fashion Country Music Hoe Down\r\n</p>\r\n<p class="description">\r\nThats right, this show will include lots of goodies at the Farm. Come see our display of Farmall Tractors, enjoy a tractor pulled hayride through the country with a special stop at our very own rendition of Petticoat Junction.\r\nThere you can enjoy a taste of cheese and wine, then back to the barn with all the comforts of the country, to enjoy some good ole country music, a chicken barbeque buffet with all the fixins and a patriotic grand finale with Donna and her horse Doc!!! Truly a spectacular event you wont want to\r\nmiss!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Hay Wagon Rides to Petticoat Junction;\r\nWine & Cheese Served</td></tr>\r\n<tr><td>12:30-1:45pm</td><td>BBQ Chicken and Sausage, Peppers and Onions; \r\nWith all the fixins and Dessert</td></tr>\r\n<tr><td>1:45-3:30pm</td><td>Country Music Hoe Down Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations Or<br /> \r\nBus Reservations Call Donna at (315)224-9085<br />\r\n</p>', NULL, '2018-01-06 06:12:58', 'dinnerShow', 0, 0, 0, 'active'),
(502, '2018-06-14 11:00:00', '<b>Elvis!!</b>', '<p class="description">\r\nBack By Popular Demand<br />\r\n2nd Year in a Row<br />\r\nA Show you wont wanna miss. Tom Gilbo (as Elvis) and his group the\r\nBlue Suedes bring back all the favorite songs youll remember of Elvis\r\nPresley. Tom will entertain you from start to finish as you shake, rattle\r\nand roll the afternoon away. Tom has all the moves and grooves and a\r\nvoice to match. The ladies will be screamin for their hugs, kisses and\r\nscarves from this terrific show! One you wont wanna let pass you by!!!!<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>11:00-12:30pm</td><td>Wagon Ride to Petticoat Junction; Wine and Cheese Servedn</td></tr>\r\n<tr><td>12:30-2:00pm</td><td>BBQ Chicken and Sausage Peppers & Onions; With all the fixins and Dessert</td></tr>\r\n<tr><td>2:00-4:30pm</td><td>Elvis Show</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nAdmission $35.00<br />\r\nFor reservations Or<br /> \r\nBus Reservations Call Donna at (315)224-9085<br />\r\n</p>\r\n', NULL, '2018-01-06 06:12:32', 'dinnerShow', 0, 0, 0, 'active'),
(503, '2018-11-28 00:00:00', 'Country Christmas Show Featuring Donna Minnoe', '<p class="dinnerDescription">\r\nHO HO Ho! Don your Western duds or your Christmas costume, but be sure to put on our dancin shoes! Donna and The Country Mystics is a fun-filled Christmas show you won\'t take sitting down! This award-winning, high-energy country band is famous for its varied repertoire of old country classics and new country hits. You\'ll hear these, along with favorite Christmas tunes, like "Rockin\' Around the Christmas Tree", "Blue Christmas", and "Jingle Bells". Then the audience becomes part of the show with "Santa Baby", "The 12 Days of Christmas", and "Dominick the Donkey". This show is sure to put you in the Christmas spirit!\r\n</p>\r\n\r\n<table class="times">\r\n<tr><td colspan="2">Time is 11:00-4:30pm</td></tr>\r\n<tr>\r\n<td class="time">11:00am</td><td>Coffee & apple streusel cake served</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Artisan jewelry, gifts, and local specialty food available</td>\r\n</tr>\r\n<tr>\r\n<td class="time">11:30am -12:30pm</td><td>Live Music & Dancing with Donna & The Country Mystics</td>\r\n</tr>\r\n<tr>\r\n<td class="time">12:00pm</td><td>Open Bar with Draft Beer, Wine & Soda</td>\r\n</tr>\r\n<tr>\r\n<td class="time">12:30pm</td><td>Family Style Meal</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Broccoli Salad</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roast Turkey with Smoked Pork Stuffing</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roast ham with Sweet Frangelieu Mustard Glaze</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roasted Garlic Smashed Potatoes & Seasonal Vegetables</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>House Made Chocolate Cake</td>\r\n</tr>\r\n<tr>\r\n<td class="time">2:00pm</td><td>Show Starts</td>\r\n</tr>\r\n<tr>\r\n<td class="time">3:30pm</td><td>Snack Before Departure</td>\r\n</tr>\r\n</table>\r\n\r\n<p>\r\nAdmission $43.00 plus Tax & Gratuity<br />\r\nSilver Birches<br 