(505, '2018-05-09 11:00:00', 'Country Jamboree\r\nFeaturing Donna Minnoe & The Country Mystics', '<p class="dinnerDescription">\r\nPut on your Western duds, kick up your heels, and get ready for a grand ole time! Donna & the Country Mystics are famous for their varied repertoire of old country classics and new country hits. Based in Central New York, these highly-talented and celbrated artists have a huge following, playing in state and country fairs, resorts, and many other venues throughout the region. The heart of the Country Mystics, Donna, is an award-winning singer and musician, selected as the Performer of the Year by the New York State Country Music Association. In 2010 she was inducted into the Cortland,NY, Country Music Hall of Fame. Be sure to wear your dancing shoes- this is one show yu won\'t take sitting down!\r\n</p>\r\n\r\n<table class="times">\r\n<tr><td colspan="2">Time is 11:00-4:30pm</td></tr>\r\n<tr>\r\n<td class="time">11:00am</td><td>Coffee & apple streusel cake served</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Artisan jewelry, gifts, and local specialty food available</td>\r\n</tr>\r\n<tr>\r\n<td class="time">11:30am -12:30pm</td><td>Live Music & Dancing</td>\r\n</tr>\r\n<tr>\r\n<td class="time">12:00pm -3:00pm</td><td>Open Bar with Draft Beer, Wine & Soda</td>\r\n</tr>\r\n<tr>\r\n<td class="time">12:30pm</td><td>Family Style Meal</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Broccoli Salad</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roast Turkey with Smoked Pork Stuffing</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roast ham with Sweet Frangelieu Mustard Glaze</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>Roasted Garlic Smashed Potatoes & Seasonal Vegetables</td>\r\n</tr>\r\n<tr>\r\n<td class="time"></td><td>House Made Chocolate Cake</td>\r\n</tr>\r\n<tr>\r\n<td class="time">2:00pm</td><td>Show Starts</td>\r\n</tr>\r\n<tr>\r\n<td class="time">3:30pm</td><td>Snack Before Departure</td>\r\n</tr>\r\n</table>\r\n\r\n<p>\r\nAdmission $43.00 plus Tax & Gratuity<br />\r\nSilver Birches<br />\r\nsilverbirchesresortpa.com<br />\r\n205 Route 507<br />\r\nHawley, PA  18428</p>', NULL, '2018-01-22 00:31:23', 'dinnerShow', 0, 0, 0, 'active'),
