(507, '2018-12-06 11:00:00', 'DONNA & THE COUNTRY MYSTICS CHRISTMAS SHOW', '<p class="dinnerDescription">\r\nA spectacular show that is back by popular demand for the 6 th year in a row! Youll be listening and singing along as you enjoy your favorite Christmas songs like Rockin Around the Christmas Tree, White Christmas, Jingle Bells, Blue Christmas and so many more. Youll enjoy the highlights as we bring out Santa Claus, Santa Baby, Dominic the Donkey and so much more! Also, bring your thinking caps for some Christmas Trivia and prizes.<br />\r\nThis is a show you will not want to miss. Due to these shows booking quickly, there are two dates to choose from.\r\n<br />\r\n</p>\r\n\r\n<table class="times">\r\n<tr><td colspan="2">Time is 12:30-4:30pm</td></tr>\r\n<tr>\r\n<td class="time">12:30pm</td><td>Roast Beef w/ all the trimmings</td>\r\n</tr>\r\n<tr>\r\n<td class="time">2:00pm</td><td>Show Starts</td>\r\n</tr>\r\n</table>\r\n\r\n<p>\r\nAdmission $32.00 \r\n<br /> For Individual Reservations call the Park at 607-753-0377.\r\n<br /> For Bus Reservations call Donna Minnoe at 315-224-9085.\r\n<br />Get your reservations early as tickets go fast and we have to turn people away!\r\n</p>\r\n\r\n<p><b>Come Early!!  The Hall of Fame is open at 11:00am!!</b>\r\n<br /> \r\n*SORRY NO DANCING DURING THE SHOW*<br />\r\nCortland Country Music Park <br />\r\n1824 State Rt. 13N, Cortland, NY 13045 <b r/>\r\nwww.cortlandmusicpark.org\r\n</p>', NULL, '2018-01-22 00:34:22', 'dinnerShow', 0, 0, 0, 'active'),
