(594, '2018-07-16 09:00:00', 'Summer Day Camp', '<p>Time: 9:00am - 2:00pm</p>\r\n<p>\r\nAll Ages Welcome!<br />\r\n<ul>\r\n<li>Horsemanship</li>\r\n<li>Ride Everyday</li>\r\n<li>Games</li>\r\n<li>Crafts</li>\r\n<li>Bounce House</li>\r\n<li>Fishing</li>\r\n<li>Gator Rides</li>\r\n<li>Paddle Boats</li>\r\n</ul>\r\n<br />\r\nPack a Bagged Lunch<br />\r\nSnacks & Juice Provided <br />\r\nContact Donna at (315)224-9085 for Pricing<br />\r\n<a href="programs.php" target="_blank">For more information about the Summer Day Camp.</a> \r\n</p>', NULL, '2016-12-29 21:17:45', 'class', 0, 0, 0, 'active'),
(595, '2018-06-16 17:00:00', 'Rockin\' Rodeo', '<p>\r\nSouthern Tier Stables 2nd Annual Rockin\' Rodeo<br />\r\n\r\n</p>\r\n\r\n<p class="description">\r\nSanctioned: *pending APRA** PCRA <br />\r\n\r\nFor information about registering call Louis Backlas @ 716-525-6011 or <br /> \r\nFacebook page: Cross Over The Line Rodeo Co. <br />\r\n\r\n** Food and refreshments will be available <br />\r\n** Beer and wine coolers will be available <br />\r\n\r\nThank you to our current sponsors! <br />\r\n<table>\r\n<tr><td>Runnings</td><td>Essex Steel</td></tr>\r\n<tr><td>R&B Alternative Solutions</td><td>Maguire Family of Dealerships</td></tr>\r\n<tr><td>Trucks and Stuff</td><td>Big Red\'s Dentistry</td></tr>\r\n<tr><td>CNY Hot Tubs</td><td>BB\'s Mechanicals</td></tr>\r\n<tr><td>Performance Automotive</td><td>Ken Delaney Excavation</td></tr>\r\n<tr><td>Moravia Rotary Club</td></tr>\r\n</table>\r\n<p>\r\n** If your company is interested in becoming a sponsor please contact Donna @315-224-9085 or email to southerntierstables@gmail.com\r\n</p>\r\n<br />\r\n</p>\r\n<p>\r\n<table>\r\n<tr><td>3:00pm</td><td>Gates Open</td></tr>\r\n<tr><td>6pm</td><td>Rodeo Starts</td></tr>\r\n<tr><td>9pm</td><td>Music by Jason Wicks Band</td></tr>\r\n</table>\r\n</p>\r\n<p>\r\nRodeo Tickets:\r\n<table>\r\n<tr><td>$15</td><td>Adult </td></tr>\r\n<tr><td>$12</td><td>Children 12 and under</td></tr>\r\n<tr><td></td><td>Children under 5 are free</td></tr>\r\n<tr><td></td><td>Music Included in price</td></tr>\r\n</table>\r\n</p>\r\n\r\n\r\n\r\n', NULL, '2018-03-19 03:13:59', 'feature', 0, 0, 0, 'active'),
